import React from 'react'
import Book from './Book'

const book1 = {
  title: "Concise Laws Of Human Nature",
  author: "Robert Greene",
  rating: 4,
  price: 20
};

const book2 = {
  title: "48 Laws Of Power",
  author: "Robert Greene",
  rating: 5,
  price: 30
};

const BookList = () => {
  return (
    <div>
        <Book
          name={book1.title}
          author={book1.author}
          rating={book1.rating}
          price={book1.price}
        />

        <Book
          name={book2.title}
          author={book2.author}
          rating={book2.rating}
          price={book2.price}
        />
    </div>
  )
}

export default BookList;
